def analyze(data):
    maxval = float(max(data))
    divisions = 5
    subsize = len(data) / divisions
    avgs = []
    relavgs = []
    for i in range(divisions):
        avgs.append(getavg(list(data[int(subsize * i):int(subsize * (i+1))])))
        relavgs.append(avgs[i]/maxval)
    global runall
    if(not runall):
        print(avgs)
        print(relavgs)
        print()
    if (relavgs[3] - relavgs[2] > .4):
        return 3
    elif(relavgs[3] > relavgs[2]) and (abs(relavgs[4] - relavgs[3]) < .2):
        return 1
    #elif(relavgs[3]-relavgs[4] > .2) and (relavgs[3] > relavgs[2]):
        #return 4

    elif(relavgs[0] < .9 and relavgs[1] < .9 and relavgs[2] < .9 and relavgs[3] < .9 and relavgs[4] < .9):
        return 2
    else:
        return 4#2
    

def getavg(l):
    sum = 0
    for i in l:
        sum += i
    return sum / len(l)

